export class Clientes {
    constructor({ Bairro, Nome, Numero, Rua, Telefone }) {
        this.Bairro = Bairro;
        this.Nome = Nome;
        this.Numero = Numero;
        this.Rua = Rua;
        this.Telefone = Telefone;
    }
}
